import React from "react";
import ProductCarousel from "../components/ProductCarousel";
import Product from "../components/Product";
import { Row, Col, Container } from "react-bootstrap";

const HomeScreen = () => {
  const prod = {
    name: "Name : Cassava",
    weight: "Weight: 100g",
    price: "Price: 150 cedis",
    category: "tuber",
    img: "./images/cereal/cassava.jfif",
  };

  return (
    <div
      style={{
        backgroundImage: "url(./images/woman.jpg)",
        backgroundRepeat: "no-repeat",
        backgroundSize: "100%",
      }}
    >
      <ProductCarousel />
      <h1 className="text-white">New products</h1>
      <Container>
        <Row>
          <Col sm={12} md={6} lg={4} xl={3}>
            <Product />
          </Col>
          <Col sm={12} md={6} lg={4} xl={3}>
            <Product />
          </Col>
          <Col sm={12} md={6} lg={4} xl={3}>
            <Product />
          </Col>
          <Col sm={12} md={6} lg={4} xl={3}>
            <Product />
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default HomeScreen;
